import React, {memo} from 'react';
import styled from 'styled-components';

const PortfolioContainer = styled.div`
    background-color: #333333;
    color:#fff !important;
    width:100%;
    height: 100vh;
`;

const Portfolio = memo(() => {
    return (
        <PortfolioContainer>
            
        </PortfolioContainer>
    );
});

export default Portfolio;
